import React from 'react';

const GameConsole = (props) => {
    let display = [...props.currentWord].map((char)=>{
        return (
            props.correctlyGuessed.includes(char) ? 
                <li>char</li> : 
                <li>"_"</li>
            )
    })
     return (
        <div>
            {display}
        </div>

     )
}

export default GameConsole
